import React, { Component } from 'react';
import { bindActionCreators } from 'redux'; 
import { connect } from 'react-redux';
import { withRouter } from 'react-router-dom';

import { 

} from '../actions/index';


class FilterCategory extends Component {

	render(){


		let categoryLabels

		if(this.props.categories){
			if(this.props.categories.rows){
				categoryLabels = this.props.categories.rows.map(category => {
					return (
						<div key={category.category_id}>
							<h3 className='white'>{category.name}</h3>
						</div>
					)
				})
			}
		}

		return(
	     	<div className='bottom-shadow' style={{backgroundColor:'white'}}>

	     		<div style={{padding:'15px'}}>
	     			{categoryLabels}
	     		</div>

	     	</div>
		);
	}
}





function mapStateToProps(state){
	return { 

	};
}

const mapDispatchToProps = (dispatch) => {
	return bindActionCreators({
		categories:state.categories.categories
	}, dispatch);
};


FilterCategory = connect(mapStateToProps, mapDispatchToProps)(FilterCategory);

export default withRouter(FilterCategory);
